INSERT INTO `cpath` VALUES (7, '6-phosphofructokinase-1', '6-phosphofructokinase-1', 'INTERACTION', 'catalysis', -9999, 'BIO_PAX', '<bp:catalysis xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-7">\r\n  <bp:COMMENT rdf:datatype="xs:string">90% of the activity present in the wild type strain is pfk-1.\r\n|CITS: [83294514]|\r\nThe enzyme shows cooperative kinetics with the substrate\r\nfructose-6-phosphate but not with the other\r\nsubstrate ATP. |CITS: [85203917]| The reverse reaction does\r\nnot participate in gluconeogenesis: fdp phosphatase mutants\r\nare deficient in gluconeogenesis.|CITS: [78194149]|\r\nStudies on phosphfructokinase-1 include subunit structure\r\n|CITS:[91255189]|, ligand binding |CITS: [91355204]| and pH\r\ndependence |CITS: [91255189]|. The allosteric properties of\r\nphosphofructokinase-1 are due in part to ligand binding and in\r\npart to the kinetics of the reaction. |CITS: [92144584]|</bp:COMMENT>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">PFK I</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-21">\r\n      <bp:SOURCE rdf:datatype="xs:string">Biochemistry 1989;28(17);6836-41</bp:SOURCE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Bras GL</bp:AUTHORS>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Teschner W</bp:AUTHORS>\r\n      <bp:TITLE rdf:datatype="xs:string">Urea-induced inactivation, dissociation, and unfolding of the allosteric phosphofructokinase from Escherichia coli.</bp:TITLE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Deville-Bonne D</bp:AUTHORS>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Garel JR</bp:AUTHORS>\r\n      <bp:ID rdf:datatype="xs:string">2531001</bp:ID>\r\n      <bp:YEAR>1989</bp:YEAR>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-22">\r\n      <bp:ID rdf:datatype="xs:string">1828369</bp:ID>\r\n      <bp:TITLE rdf:datatype="xs:string">pH dependence of the kinetic properties of allosteric phosphofructokinase from Escherichia coli.</bp:TITLE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Deville-Bonne D</bp:AUTHORS>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Bourgain F</bp:AUTHORS>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:SOURCE rdf:datatype="xs:string">Biochemistry 1991;30(23);5750-4</bp:SOURCE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Garel JR</bp:AUTHORS>\r\n      <bp:YEAR>1991</bp:YEAR>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:COFACTOR>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-23">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1.0</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-53" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:COFACTOR>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-24">\r\n      <bp:AUTHORS rdf:datatype="xs:string">Evans PR</bp:AUTHORS>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Rypniewski WR</bp:AUTHORS>\r\n      <bp:TITLE rdf:datatype="xs:string">Crystal structure of unliganded phosphofructokinase from Escherichia coli.</bp:TITLE>\r\n      <bp:YEAR>1989</bp:YEAR>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:SOURCE rdf:datatype="xs:string">J Mol Biol 1989;207(4);805-21</bp:SOURCE>\r\n      <bp:ID rdf:datatype="xs:string">2527305</bp:ID>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-25">\r\n      <bp:AUTHORS rdf:datatype="xs:string">Garel JR</bp:AUTHORS>\r\n      <bp:TITLE rdf:datatype="xs:string">A conformational transition involved in antagonistic substrate binding to the allosteric phosphofructokinase from Escherichia coli.</bp:TITLE>\r\n      <bp:YEAR>1992</bp:YEAR>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Deville-Bonne D</bp:AUTHORS>\r\n      <bp:SOURCE rdf:datatype="xs:string">Biochemistry 1992;31(6);1695-700</bp:SOURCE>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">1531298</bp:ID>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-26">\r\n      <bp:ID rdf:datatype="xs:string">2975709</bp:ID>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Shirakihara Y</bp:AUTHORS>\r\n      <bp:SOURCE rdf:datatype="xs:string">J Mol Biol 1988;204(4);973-94</bp:SOURCE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Evans PR</bp:AUTHORS>\r\n      <bp:YEAR>1988</bp:YEAR>\r\n      <bp:TITLE rdf:datatype="xs:string">Crystal structure of the complex of phosphofructokinase from Escherichia coli with its reaction products.</bp:TITLE>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-27">\r\n      <bp:ID rdf:datatype="xs:string">2140983</bp:ID>\r\n      <bp:TITLE rdf:datatype="xs:string">Role of the C-terminal region in the allosteric properties of Escherichia coli phosphofructokinase-1.</bp:TITLE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Serre MC</bp:AUTHORS>\r\n      <bp:SOURCE rdf:datatype="xs:string">Eur J Biochem 1990;189(3);487-92</bp:SOURCE>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Garel JR</bp:AUTHORS>\r\n      <bp:YEAR>1990</bp:YEAR>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:NAME rdf:datatype="xs:string">6-phosphofructokinase-1</bp:NAME>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-28">\r\n      <bp:YEAR>1991</bp:YEAR>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Evans PR</bp:AUTHORS>\r\n      <bp:ID rdf:datatype="xs:string">1832014</bp:ID>\r\n      <bp:SOURCE rdf:datatype="xs:string">Biochemistry 1991;30(34);8477-80</bp:SOURCE>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:TITLE rdf:datatype="xs:string">Steady-state fluorescence of Escherichia coli phosphofructokinase reveals a regulatory role for ATP.</bp:TITLE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Berger SA</bp:AUTHORS>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:CONTROLLED rdf:resource="#CPATH-8" />\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-29">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-59" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:CONTROLLER>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">fructose-6-p-1-kinase</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">fructose-6-phosphate-1-phosphotransferase</bp:SYNONYMS>\r\n  <bp:DIRECTION rdf:datatype="xs:string">REVERSIBLE</bp:DIRECTION>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-391">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">7</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:catalysis>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
