INSERT INTO `cpath` VALUES (9, 'phosphoglycerate mutase, cofactor independent', 'phosphoglycerate mutase, cofactor independent', 'INTERACTION', 'catalysis', -9999, 'BIO_PAX', '<bp:catalysis xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-9">\r\n  <bp:CONTROLLED rdf:resource="#CPATH-10" />\r\n  <bp:SYNONYMS rdf:datatype="xs:string">D-phosphoglycerate 2,3-phosphomutase</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">PGAM, cofactor independent</bp:SYNONYMS>\r\n  <bp:DIRECTION rdf:datatype="xs:string">REVERSIBLE</bp:DIRECTION>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">phosphoglycerate mutase, BPG-independent</bp:SYNONYMS>\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-41">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-64" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:CONTROLLER>\r\n  <bp:NAME rdf:datatype="xs:string">phosphoglycerate mutase, cofactor independent</bp:NAME>\r\n  <bp:COFACTOR>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-42">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-65" />\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1.0</bp:STOICHIOMETRIC-COEFFICIENT>\r\n    </bp:physicalEntityParticipant>\r\n  </bp:COFACTOR>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">iPGM</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">BPG-independent PGAM</bp:SYNONYMS>\r\n  <bp:COMMENT rdf:datatype="xs:string">E. coli contains three phosphoglycerate mutases.\r\nTwo are 2,3-bisphosphoglycerate-dependent enzymes,\r\nencoded by the gpmA and gpmB genes. The third is a\r\n2,3-bisphosphoglycerate-independent enzyme encoded\r\nby the pgmI gene.  The two cofactor-dependent enzymes\r\nare similar in sequence while the cofactor-independent \r\nenzyme is unrelated. The cofactor-dependent enzymes\r\nhave ten times higher specific activity compared to the\r\ncofactor-independent enzyme.  |CITS: [99364512]|</bp:COMMENT>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">phosphoglyceromutase</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">phosphoglycerate mutase, 2,3-bisphosphoglycerate-independent</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">phosphoglycerate phosphomutase</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-393">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">9</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:catalysis>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
