alReaction>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (11, 'phosphoglycerate mutase 1', 'phosphoglycerate mutase 1', 'INTERACTION', 'catalysis', -9999, 'BIO_PAX', '<bp:catalysis xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-11">\r\n  <bp:SYNONYMS rdf:datatype="xs:string">D-phosphoglycerate 2,3-phosphomutase 1</bp:SYNONYMS>\r\n  <bp:COMMENT rdf:datatype="xs:string">E. coli contains three phosphoglycerate mutases.\r\nTwo are 2,3-bisphosphoglyerate-dependent enzymes,\r\nencoded by the gpmA and gpmB genes. The third is a\r\n2,3-bisphosphoglyerate-independent enzyme encoded\r\nby the pgmI gene.   |CITS: [99364512]|</bp:COMMENT>\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-47">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-66" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:CONTROLLER>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">PGAM 1</bp:SYNONYMS>\r\n  <bp:NAME rdf:datatype="xs:string">phosphoglycerate mutase 1</bp:NAME>\r\n  <bp:CONTROLLED rdf:resource="#CPATH-10" />\r\n  <bp:SYNONYMS rdf:datatype="xs:string">phosphoglyceromutase 1</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">BPG-dependent PGAM1</bp:SYNONYMS>\r\n  <bp:DIRECTION rdf:datatype="xs:string">REVERSIBLE</bp:DIRECTION>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">phosphoglycerate phosphomutase 1</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-395">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">11</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:catalysis>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (12, 'enolase', 'enolase', 'INTERACTION', 'catalysis', -9999, 'BIO_PAX', '<bp:catalysis xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-12">\r\n  <bp:DIRECTION rdf:datatype="xs:string">REVERSIBLE</bp:DIRECTION>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">2,3-diphospho-D-glycerate</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">2-phospho-D-glycerate hydrolyase</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">phosphopyruvate hydratase</bp:SYNONYMS>\r\n  <bp:NAME rdf:datatype="xs:string">enolase</bp:NAME>\r\n  <bp:CONTROLLED rdf:resource="#CPATH-13" />\r\n  <bp:COMMENT rdf:datatype="xs:string">There are two active sites per active dimer. Functionally\r\nthere are many similarities between E. coli enolase and other enolases\r\nstudied. Thus the dependence on Mg for activity and the inhibition by\r\nfluoride in the presence of phosphate are quantitatively very similar\r\nfor all enolases. Other catalytic parameters are also similar but minor\r\nquantitative distinctions indicate that E. coli enolase is more closely\r\nrelated to yeast enolase than to enolases from vertebrate muscle.\r\nThe pH optimum of 8.1 is significantly higher than that for vertebrate\r\nenolases and even somewhat above that of yeast and plant enolases.\r\n|CITS:[72060411]|</bp:COMMENT>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-48">\r\n      <bp:AUTHORS rdf:datatype="xs:string">Wold F</bp:AUTHORS>\r\n      <bp:YEAR>1971</bp:YEAR>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Spring TG</bp:AUTHORS>\r\n      <bp:SOURCE rdf:datatype="xs:string">J Biol Chem 1971;246(22);6797-802</bp:SOURCE>\r\n      <bp:ID rdf:datatype="xs:string">4942326</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:TITLE rdf:datatype="xs:string">The purification and characterization of Escherichia coli enolase.</bp:TITLE>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">2-phosphoglycerate dehydratase</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">2-phospho-D glycerate phosphotransferase</bp:SYNONYMS>\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-49">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-70" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:CONTROLLER>\r\n  <bp:COFACTOR>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-50">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1.0</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-53" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:COFACTOR>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-396">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">12</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:catalysis>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
