INSERT INTO `cpath` VALUES (14, 'N/A', 'N/A', 'INTERACTION', 'modulation', -9999, 'BIO_PAX', '<bp:modulation xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-14">\r\n  <bp:CONTROL-TYPE rdf:datatype="xs:string">INHIBITION-UNKMECH</bp:CONTROL-TYPE>\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-56">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-72" />\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1.0</bp:STOICHIOMETRIC-COEFFICIENT>\r\n    </bp:physicalEntityParticipant>\r\n  </bp:CONTROLLER>\r\n  <bp:CONTROLLED rdf:resource="#CPATH-12" />\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-398">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">14</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:modulation>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (15, 'N/A', 'N/A', 'INTERACTION', 'modulation', -9999, 'BIO_PAX', '<bp:modulation xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-15">\r\n  <bp:COMMENT rdf:datatype="xs:string">high concentrations of Mg+2 and ADP |CITS:[89228557]|</bp:COMMENT>\r\n  <bp:CONTROL-TYPE rdf:datatype="xs:string">INHIBITION-UNKMECH</bp:CONTROL-TYPE>\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-57">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:CELLULAR-LOCATION>\r\n        <bp:openControlledVocabulary rdf:ID="CPATH-LOCAL-58">\r\n          <bp:TERM>cytoplasm</bp:TERM>\r\n          <bp:XREF>\r\n            <bp:unificationXref rdf:ID="CPATH-LOCAL-59">\r\n              <bp:DB>GO</bp:DB>\r\n              <bp:ID>GO:0005737</bp:ID>\r\n            </bp:unificationXref>\r\n          </bp:XREF>\r\n        </bp:openControlledVocabulary>\r\n      </bp:CELLULAR-LOCATION>\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-58" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:CONTROLLER>\r\n  <bp:CONTROLLED rdf:resource="#CPATH-16" />\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-399">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">15</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:modulation>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (16, 'pyruvate kinase I', 'pyruvate kinase I', 'INTERACTION', 'catalysis', -9999, 'BIO_PAX', '<bp:catalysis xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-16">\r\n  <bp:COFACTOR>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-60">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-73" />\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1.0</bp:STOICHIOMETRIC-COEFFICIENT>\r\n    </bp:physicalEntityParticipant>\r\n  </bp:COFACTOR>\r\n  <bp:COFACTOR>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-61">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1.0</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-53" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:COFACTOR>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">pyruvate kinase</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">phosphoenol transphosphorylase</bp:SYNONYMS>\r\n  <bp:CONTROLLED rdf:resource="#CPATH-17" />\r\n  <bp:SYNONYMS rdf:datatype="xs:string">pyruvate 2-0-phosphotransferase</bp:SYNONYMS>\r\n  <bp:DIRECTION rdf:datatype="xs:string">REVERSIBLE</bp:DIRECTION>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">type I pyruvate kinase</bp:SYNONYMS>\r\n  <bp:COMMENT rdf:datatype="xs:string">Pyruvate kinase I is strongly activated by fructose 1,6\r\nbisphosphate and shows sigmoid kinetics with respect to the substrate\r\nphophoenolpyruvate.  The dependences of the reaction\r\nrate on the concentrations of phosphoenolpyruvate, Mg&lt;SUP&gt;+2&lt;/SUP&gt;, and Mn&lt;SUP&gt;+2&lt;/SUP&gt; are\r\nsigmoid.  These dependences become hyperbolic on addition of fructose\r\n1,6 bisphosphate. The dependences of the reaction rate on the\r\nconcentration of ADP are always hyperbolic. The catalytic active complex of\r\nE. coli pyruvate kinase is formed by only one conformational state of\r\nthe enzyme, state R1.  This state binds randomly the Mg&lt;SUP&gt;+2&lt;/SUP&gt; free ligands\r\nADP or phosphoenolpyruvate.  Thereafter, the active enzyme complex is\r\nformed by binding Mg&lt;SUP&gt;+2&lt;/SUP&gt;-PEP or Mg&lt;SUP&gt;+2&lt;/SUP&gt;ADP respectively.  State R2 of coli\r\npyruvate kinase binds randomly ADP and Mg&lt;SUP&gt;+2&lt;/SUP&gt;. It is the only state in\r\nwhich Mg&lt;SUP&gt;+2&lt;/SUP&gt; can bind to the free enzyme.  Mg&lt;SUP&gt;+2&lt;/SUP&gt; is not necesary for the\r\nbinding of ADP, PEP an ATP.  Mg&lt;SUP&gt;+2&lt;/SUP&gt; can inhibit either by binding to the\r\nstate R2 or by lowering the concentration of Mg&lt;SUP&gt;+2&lt;/SUP&gt;, free ADP and PEP\r\nthrough complex formation.  ATP inhibits by virtue of three effects:\r\nincrease in ionic strength, complex-formation with Mg&lt;SUP&gt;+2&lt;/SUP&gt; when this metal\r\nion acts as an activator and binding to the state R3.  However when\r\nconditions are such that Mg&lt;SUP&gt;+2&lt;/SUP&gt; is an inhibitor, then ATP is expected to\r\nactivate because of complex formation with Mg&lt;SUP&gt;+2&lt;/SUP&gt;. In general, one can say\r\nthat the ligands Mg&lt;SUP&gt;+2&lt;/SUP&gt; and ATP cannot be classified as inhibitors or\r\nactivators because their regulatory effect on the reaction rate depends\r\non the concentration of the other ligands.|CITS:[81159972]| By\r\naddition of fructose-1,6-bisphosphate the sigmoid kinetics with respect to\r\nphosphoenolpyruvate and Mg&lt;SUP&gt;+2&lt;/SUP&gt; is abolished and the activity of the enzyme\r\nis described by classical saturation kinetics.  This is explained by\r\nexclusive binding of fructose 1,6 bisphosphate at an allosteric site of\r\nthe conformational state that forms the active complex. Ca&lt;SUP&gt;+2&lt;/SUP&gt; is an activator \r\nof the enzyme at low Mg&lt;SUP&gt;+2&lt;/SUP&gt; and Ca&lt;SUP&gt;+2&lt;/SUP&gt; concentrations;\r\notherwise it is an inhibitor.  These effects can be understood by\r\nassuming that Ca&lt;SUP&gt;+2&lt;/SUP&gt; has the same binding properties as Mg&lt;SUP&gt;+2&lt;/SUP&gt;, although it\r\ndoes not allow a catalytic turnover.|CITS:[83282602]| The enzyme requires both bivalent and monovalent cations.  |CITS: [90336973]|</bp:COMMENT>\r\n  <bp:NAME rdf:datatype="xs:string">pyruvate kinase I</bp:NAME>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">pyruvate kinase F</bp:SYNONYMS>\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-62">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-75" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:CONTROLLER>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">phosphoenolpyruvate kinase</bp:SYNONYMS>\r\n  <bp:COFACTOR>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-63">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-65" />\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1.0</bp:STOICHIOMETRIC-COEFFICIENT>\r\n    </bp:physicalEntityParticipant>\r\n  </bp:COFACTOR>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-400">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">16</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:catalysis>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (17, 'phosphoenolpyruvate dephosphorylation', 'phosphoenolpyruvate dephosphorylation', 'INTERACTION', 'biochemicalReaction', -9999, 'BIO_PAX', '<bp:biochemicalReaction xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-17">\r\n  <bp:RIGHT>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-64">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-68" />\r\n      <bp:CELLULAR-LOCATION>\r\n        <bp:openControlledVocabulary rdf:ID="CPATH-LOCAL-65">\r\n          <bp:TERM>cytoplasm</bp:TERM>\r\n          <bp:XREF>\r\n            <bp:unificationXref rdf:ID="CPATH-LOCAL-66">\r\n              <bp:DB>GO</bp:DB>\r\n              <bp:ID>GO:0005737</bp:ID>\r\n            </bp:unificationXref>\r\n          </bp:XREF>\r\n        </bp:openControlledVocabulary>\r\n      </bp:CELLULAR-LOCATION>\r\n    </bp:physicalEntityParticipant>\r\n  </bp:RIGHT>\r\n  <bp:LEFT>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-67">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:CELLULAR-LOCATION rdf:resource="#CPATH-LOCAL-65" />\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-58" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:LEFT>\r\n  <bp:NAME rdf:datatype="xs:string">phosphoenolpyruvate dephosphorylation</bp:NAME>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">pyruvate phosphorylation</bp:SYNONYMS>\r\n  <bp:LEFT>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-68">\r\n      <bp:CELLULAR-LOCATION rdf:resource="#CPATH-LOCAL-65" />\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-74" />\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1</bp:STOICHIOMETRIC-COEFFICIENT>\r\n    </bp:physicalEntityParticipant>\r\n  </bp:LEFT>\r\n  <bp:EC-NUMBER rdf:datatype="xs:string">2.7.1.40</bp:EC-NUMBER>\r\n  <bp:RIGHT>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-69"