INSERT INTO `cpath` VALUES (25, 'phosphoglycerate mutase 2', 'phosphoglycerate mutase 2', 'INTERACTION', 'catalysis', -9999, 'BIO_PAX', '<bp:catalysis xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-25">\r\n  <bp:CONTROLLED rdf:resource="#CPATH-10" />\r\n  <bp:SYNONYMS rdf:datatype="xs:string">D-phosphoglycerate 2,3-phosphomutase 2</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">PGAM2</bp:SYNONYMS>\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-87">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-83" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:CONTROLLER>\r\n  <bp:DIRECTION rdf:datatype="xs:string">REVERSIBLE</bp:DIRECTION>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">phosphoglyceromutase 2</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">BPG-dependent PGAM2</bp:SYNONYMS>\r\n  <bp:COMMENT rdf:datatype="xs:string">E. coli contains three phosphoglycerate mutases.\r\nTwo are 2,3-bisphosphoglyerate-dependent enzymes,\r\nencoded by the gpmA and gpmB genes. The third is a\r\n2,3-bisphosphoglyerate-independent enzyme encoded\r\nby the pgmI gene.   |CITS: [99364512]|</bp:COMMENT>\r\n  <bp:NAME rdf:datatype="xs:string">phosphoglycerate mutase 2</bp:NAME>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">phosphoglycerate phosphomutase 2</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-409">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">25</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:catalysis>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
