INSERT INTO `cpath` VALUES (27, 'glyceraldehyde 3-phosphate dehydrogenase-A complex', 'glyceraldehyde 3-phosphate dehydrogenase-A complex', 'INTERACTION', 'catalysis', -9999, 'BIO_PAX', '<bp:catalysis xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-27">\r\n  <bp:COMMENT rdf:datatype="xs:string">The E.coli sequence contains a certain number of amino\r\n acids which are conserved in all GAPDHs so far sequenced and which are\r\n postulated to be directly implicated in the NAD+ binding or in the\r\n catalysis mechanism. |CITS:[85257641]| There appear to be only two\r\n active sites per molecule.|CITS:[79255500]| NAD required for the\r\nphosphorylation as well as the oxidation |CITS:[79255500]|</bp:COMMENT>\r\n  <bp:DIRECTION rdf:datatype="xs:string">REVERSIBLE</bp:DIRECTION>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-96">\r\n      <bp:AUTHORS rdf:datatype="xs:string">Vignais ML</bp:AUTHORS>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Seta FD</bp:AUTHORS>\r\n      <bp:SOURCE rdf:datatype="xs:string">J Bacteriol 1997;179(16);5218-21</bp:SOURCE>\r\n      <bp:TITLE rdf:datatype="xs:string">Characterization of Escherichia coli strains with gapA and gapB genes deleted.</bp:TITLE>\r\n      <bp:YEAR>1997</bp:YEAR>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Boschi-Muller S</bp:AUTHORS>\r\n      <bp:ID rdf:datatype="xs:string">9260967</bp:ID>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Branlant G</bp:AUTHORS>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:CONTROLLED rdf:resource="#CPATH-26" />\r\n  <bp:SYNONYMS rdf:datatype="xs:string">triosephosphate dehydrogenase</bp:SYNONYMS>\r\n  <bp:NAME rdf:datatype="xs:string">glyceraldehyde 3-phosphate dehydrogenase-A complex</bp:NAME>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">GAPDH-A</bp:SYNONYMS>\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-