ycerate.|CITS:[90336971]|</bp:COMMENT>\r\n  <bp:EC-NUMBER rdf:datatype="xs:string">2.7.2.3</bp:EC-NUMBER>\r\n  <bp:RIGHT>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-105">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:CELLULAR-LOCATION rdf:resource="#CPATH-LOCAL-103" />\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-61" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:RIGHT>\r\n  <bp:LEFT>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-106">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-62" />\r\n      <bp:CELLULAR-LOCATION rdf:resource="#CPATH-LOCAL-103" />\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1</bp:STOICHIOMETRIC-COEFFICIENT>\r\n    </bp:physicalEntityParticipant>\r\n  </bp:LEFT>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-412">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">28</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:biochemicalReaction>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
