INSERT INTO `cpath` VALUES (30, 'phosphoglycerate kinase', 'phosphoglycerate kinase', 'INTERACTION', 'catalysis', -9999, 'BIO_PAX', '<bp:catalysis xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-30">\r\n  <bp:SYNONYMS rdf:datatype="xs:string">2,3-diphospho-D-glycerate</bp:SYNONYMS>\r\n  <bp:CONTROLLED rdf:resource="#CPATH-28" />\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-110">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-90" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:CONTROLLER>\r\n  <bp:COMMENT rdf:datatype="xs:string">The structure of Pgk determined crystallographically is best\r\ndescribed as an open bi-lobal molecule.  The active site of the enzyme lies\r\ndeep in the cleft formed between the two lobes.|CITS:[90336971]|\r\nWhen purified enzymes\r\nwere employed there was absolute dependence upon the respective\r\nsubstrates of the glycolytic pathway.  There was no activity unless\r\nATP and glycerate-3-P were both included.|CITS:[71230170]|</bp:COMMENT>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">2-phospho-D-glycerate phosphotransferase</bp:SYNONYMS>\r\n  <bp:DIRECTION rdf:datatype="xs:string">REVERSIBLE</bp:DIRECTION>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">3-phosphoglycerate kinase</bp:SYNONYMS>\r\n  <bp:NAME rdf:datatype="xs:string">phosphoglycerate kinase</bp:NAME>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">Glycerate 3-P kinase</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-414">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">30</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:catalysis>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
