INSERT INTO `cpath` VALUES (35, '6-phosphofructokinase-2', '6-phosphofructokinase-2', 'INTERACTION', 'catalysis', -9999, 'BIO_PAX', '<bp:catalysis xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-35">\r\n  <bp:DIRECTION rdf:datatype="xs:string">REVERSIBLE</bp:DIRECTION>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-123">\r\n      <bp:YEAR>1981</bp:YEAR>\r\n      <bp:SOURCE rdf:datatype="xs:string">Eur J Biochem 1981;117(3);569-74</bp:SOURCE>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:TITLE rdf:datatype="xs:string">Regulatory properties of phosphofructokinase 2 from Escherichia coli.</bp:TITLE>\r\n      <bp:ID rdf:datatype="xs:string">6456900</bp:ID>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Kotlarz D</bp:AUTHORS>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Buc H</bp:AUTHORS>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">fructose-6-phosphate-1-phosphotransferase</bp:SYNONYMS>\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-124">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-95" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:CONTROLLER>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">PFK II</bp:SYNONYMS>\r\n  <bp:NAME rdf:datatype="xs:string">6-phosphofructokinase-2</bp:NAME>\r\n  <bp:CONTROLLED rdf:resource="#CPATH-8" />\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-125">\r\n      <bp:ID rdf:datatype="xs:string">149128</bp:ID>\r\n      <bp:SOURCE rdf:datatype="xs:string">J Biol Chem 1978;253(12);4350-5</bp:SOURCE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Babul J</bp:AUTHORS>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:YEAR>1978</bp:YEAR>\r\n      <bp:TITLE rdf:datatype="xs:string">Phosphofructokinases from Escherichia coli. Purification and characterization of the nonallosteric isozyme.</bp:TITLE>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">fructose-6-p-1-kinase</bp:SYNONYMS>\r\n  <bp:COMMENT rdf:datatype="xs:string">Pfk-2 is somewhat sensitive to inhibition by\r\nfructose-1,6-diphosphate and ATP. Pfk-2,unlike pfk-1, does not\r\nshow cooperative interaction with fructose-6-phosphate, inhibition by\r\nPEP or activation by ADP. |CITS:[84262485]| MgATP is an inhibitor of\r\npfk-2 and it provokes the tetramerization of the dimeric native\r\nenzyme.|CITS: [85289307],[88292964]| Its normal function is not\r\nknown and in strains with pfk-1, pfkB may be\r\ndeleted without apparent effect. |CITS: [83294514]| However in the\r\nabsence of pfk-1, slow growth on sugars depends on pfk-2. Its loss\r\ncauses complete inability to grow. |CITS: [84262485]|\r\nThe distribution of the two phosphofructokinases is variable\r\namong enterobacteria and also among E.coli strains |CITS: [82027179]|</bp:COMMENT>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-419">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">35</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:catalysis>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (36, 'PGLUCISOM-RXN', 'PGLUCISOM-RXN', 'INTERACTION', 'biochemicalReaction', -9999, 'BIO_PAX', '<bp:biochemicalReaction xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-36">\r\n  <bp:LEFT>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-126">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-98" />\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:CELLULAR-LOCATION>\r\n        <bp:openControlledVocabulary rdf:ID="CPATH-LOCAL-127">\r\n          <bp:TERM>cytoplasm</bp:TERM>\r\n          <bp:XREF>\r\n            <bp:unificationXref rdf:ID="CPATH-LOCAL-128">\r\n              <bp:DB>GO</bp:DB>\r\n              <bp:ID>GO:0005737</bp:ID>\r\n            </bp:unificationXref>\r\n          </bp:XREF>\r\n        </bp:openControlledVocabulary>\r\n      </bp:CELLULAR-LOCATION>\r\n    </bp:physicalEntityParticipant>\r\n  </bp:LEFT>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">PHOSPHOGLUCOISOMERASE</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">OXOISOMERASE</bp:SYNONYMS>\r\n  <bp:EC-NUMBER rdf:datatype="xs:string">5.3.1.9</bp:EC-NUMBER>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">PHOSPHOGLUCOSE ISOMERASE</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">PHOSPHOSACCHAROMUTASE</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">PHOSPHOHEXOMUTASE</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">PHOSPHOHEXOISOMERASE</bp:SYNONYMS>\r\n  <bp:DELTA-G>0.4</bp:DELTA-G>\r\n  <bp:RIGHT>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-129">\r\n      <bp:CELLULAR-LOCATION rdf:resource="#CPATH-LOCAL-127" />\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-55" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:RIGHT>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">HEXOSEPHOSPHATE ISOMERASE</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">PHOSPHOHEXOSE ISOMERASE</bp:SYNONYMS>\r\n  <bp:NAME rdf:datatype="xs:string">PGLUCISOM-RXN</bp:NAME>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-420">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">36</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:biochemicalReaction>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (37, 'fructose bisphosphate aldolase class I', 'fructose bisphosphate aldolase class I', 'INTERACTION', 'catalysis', -9999, 'BIO_PAX', '<bp:catalysis xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-37">\r\n  <bp:COMMENT rdf:datatype="xs:string">When E. coli K-12 is grown on C-3 carbon sources both classes of aldolase are \r\npresent.  However the Class I enzyme is present only under these conditions.  \r\nTherefore it is likely that the Class I enzyme is involved in gluconeogenesis\r\nand the class II enzyme in glycolysis. |CITS: [81000551]|\r\nThe class I enzymes function by imine formation between the\r\n substrate and a catalytically essential lysine residue in the active\r\n site, which acts to stabilize the intermediate carbanion. |CITS:[89193446]|\r\n They form a Schiff base betwen the E-amino group of a specific lysine\r\n residue in the active site and the carbonyl group of the substrate.\r\n This imine may be reduced by borohydride which therefore irreversibly\r\n inhibits class 1 aldolases in the presence of substrate. |CITS:[73229139]|\r\n The enzyme''s activity was unaffected by EDTA, but it was inhibited by\r\n borohydride reduction in the presence of Fru-1,6-P2 or\r\n dihydroxyacetone phosphate.  Like mammalian aldolases, it cleaved\r\n fructose 1-phosphate, albeit slowly and had a low Km for Fru-1,6-P2.\r\n Its fructose 1,6 bisphosphate cleavage activity was greatly enhanced\r\n by citrate, PEP, 2-oxoglutarate and sn-glycerol 3-phosphate. Aldolase I\r\n is very efficient at Fru-1,6-P2 cleavage when fully activated.\r\n Only a limited range of metabolites has been tested  as\r\n possible activators. In contrast, its fructose 1-phosphate cleavage\r\n activity was unaffected by these compounds.  The enhancement\r\n exhibited a strong dependence on pH.\r\n These novel kinetic properties do not seem to be shared by any other\r\n fructose 1,6 bisphosphate aldolase. In view of its unusual properties,\r\n it is unlikely that aldolase I from E.coli is closely related to the\r\n class-1 aldolases that have been detected in several other prokaryotes,\r\n or to the typical class I enzymes from eukaryote. |CITS: [78165652]|</bp:COMMENT>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-130">\r\n      <bp:AUTHORS rdf:datatype="xs:string">Howlett GJ</bp:AUTHORS>\r\n      <bp:ID rdf:datatype="xs:string">9531482</bp:ID>\r\n      <bp:YEAR>1998</bp:YEAR>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:SOURCE rdf:datatype="xs:string">Biochem J 1998;331 ( Pt 2);437-45</bp:SOURCE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Berry A</bp:AUTHORS>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Thomson GJ</bp:AUTHORS>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Ashcroft AE</bp:AUTHORS>\r\n      <bp:TITLE rdf:datatype="xs:string">The dhnA gene of Escherichia coli encodes a class I fructose bisphosphate aldolase.</bp:TITLE>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-131">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-103" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:CONTROLLER>\r\n  <bp:NAME rdf:datatype="xs:string">fructose bisphosphate aldolase class I</bp:NAME>\r\n  <bp:DIRECTION rdf:datatype="xs:string">REVERSIBLE</bp:DIRECTION>\r\n  <bp:CONTROLLED rdf:resource="#CPATH-38" />\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-421">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">37</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:catalysis>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (38, 'F16ALDOLASE-RXN', 'F16ALDOLASE-RXN', 'INTERACTION', 'biochemicalReaction', -9999, 'BIO_PAX', '<bp:biochemicalReaction xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-38">\r\n  <bp:NAME rdf:datatype="xs:string">F16ALDOLASE-RXN</bp:NAME>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">FRUCTOSE-1,6-BISPHOSPHATE TRIOSEPHOSPHATE-LYASE</bp:SYNONYMS>\r\n  <bp:RIGHT>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-132">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:CELLULAR-LOCATION>\r\n        <bp:openControlledVocabulary rdf:ID="CPATH-LOCAL-133">\r\n          <bp:TERM>cytoplasm</bp:TERM>\r\n          <bp:XREF>\r\n            <bp:unificationXref rdf:ID="CPATH-LOCAL-134">\r\n              <bp:DB>GO</bp:DB>\r\n              <bp:ID>GO:0005737</bp:ID>\r\n            </bp:unificationXref>\r\n          </bp:XREF>\r\n        </bp:openControlledVocabulary>\r\n      </bp:CELLULAR-LOCATION>\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-93" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:RIGHT>\r\n  <bp:COMMENT rdf:datatype="xs:string">Dihydroxyacetone phosphate is also called glycerone\r\nphosphate.\r\nOf the total aldolase activity in cell-free extracts of E.coli grown on\r\npyruvate and lactate, approx. 60 % was accounted for by aldolase 1. On\r\nthe other hand, E.coli grown on glucose showed no aldolase 1 activity\r\nbut had an increased aldolase 2 activity. |CITS: [73229139]|\r\nDuring growth with CO2 as a  carbon source, only class I aldolase is\r\nproduced but when acetate replaces CO2 the class II aldolase is made.\r\nSimilarly, in E.coli the putative class I aldolase is only synthesized\r\nduring growth on C3 compounds and not on glucose, implying that a\r\nclass I aldolase is preferred for gluconeogenesis |CITS:[73229139]|</bp:COMMENT>\r\n  <bp:DELTA-G>5.7</bp:DELTA-G>\r\n  <bp:EC-NUMBER rdf:datatype="xs:string">4.1.2.13</bp:EC-NUMBER>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">ALDOLASE</bp:SYNONYMS>\r\n  <bp:LEFT>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-135">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-57" />\r\n      <bp:CELLULAR-LOCATION rdf:resource="#CPATH-LOCAL-133" />\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1</bp:STOICHIOMETRIC-COEFFICIENT>\r\n    </bp:physicalEntityParticipant>\r\n  </bp:LEFT>\r\n  <bp:RIGHT>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-136">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:CELLULAR-LOCATION rdf:resource="#CPATH-LOCAL-133" />\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-86" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:RIGHT>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-422">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">38</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:biochemicalReaction>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (39, 'triose phosphate isomerase', 'triose phosphate isomerase', 'INTERACTION', 'catalysis', -9999, 'BIO_PAX', '<bp:catalysis xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-39">\r\n  <bp:SYNONYMS rdf:datatype="xs:string">phosphotriose isomerase</bp:SYNONYMS>\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-137">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-99" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:CONTROLLER>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">triosephosphate isomerase</bp:SYNONYMS>\r\n  <bp:COMMENT rdf:datatype="xs:string">The amino acid sequence around the active site is perfectly\r\nconserved in all known triose phosphate isomerases and can be\r\nused as a signature pattern\r\nfor this type of enzyme.|CITS: [Prosite]|</bp:COMMENT>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">TIM</bp:SYNONYMS>\r\n  <bp:CONTROLLED rdf:resource="#CPATH-40" />\r\n  <bp:SYNONYMS rdf:datatype="xs:string">triosephosphate mutase</bp:SYNONYMS>\r\n  <bp:NAME rdf:datatype="xs:string">triose phosphate isomerase</bp:NAME>\r\n  <bp:DIRECTION rdf:datatype="xs:string">REVERSIBLE</bp:DIRECTION>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-423">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">39</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:catalysis>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (40, 'triose phosphate isomerization', 'triose phosphate isomerization', 'INTERACTION', 'biochemicalReaction', -9999, 'BIO_PAX', '<bp:biochemicalReaction xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-40">\r\n  <bp:SYNONYMS rdf:datatype="xs:string">PHOSPHOTRIOSE ISOMERASE</bp:SYNONYMS>\r\n  <bp:EC-NUMBER rdf:datatype="xs:string">5.3.1.1</bp:EC-NUMBER>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">TRIOSEPHOSPHATE MUTASE</bp:SYNONYMS>\r\n  <bp:LEFT>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-138">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:CELLULAR-LOCATION>\r\n        <bp:openControlledVocabulary rdf:ID="CPATH-LOCAL-139">\r\n          <bp:TERM>cytoplasm</bp:TERM>\r\n          <bp:XREF>\r\n            <bp:unificationXref rdf:ID="CPATH-LOCAL-140">\r\n              <bp:DB>GO</bp:DB>\r\n              <bp:ID>GO:0005737</bp:ID>\r\n            </bp:unificationXref>\r\n          </bp:XREF>\r\n        </bp:openControlledVocabulary>\r\n      </bp:CELLULAR-LOCATION>\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-86" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:LEFT>\r\n  <bp:NAME rdf:datatype="xs:string">triose phosphate isomerization</bp:NAME>\r\n  <bp:RIGHT>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-141">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>1</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:CELLULAR-LOCATION rdf:resource="#CPATH-LOCAL-139" />\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-93" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:RIGHT>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-424">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">40</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:biochemicalReaction>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
