INSERT INTO `cpath` VALUES (42, 'fructose bisphosphate aldolase class II', 'fructose bisphosphate aldolase class II', 'INTERACTION', 'catalysis', -9999, 'BIO_PAX', '<bp:catalysis xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-42">\r\n  <bp:NAME rdf:datatype="xs:string">fructose bisphosphate aldolase class II</bp:NAME>\r\n  <bp:CONTROLLED rdf:resource="#CPATH-38" />\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-143">\r\n      <bp:TITLE rdf:datatype="xs:string">Purification and characterization of two fructose diphosphate aldolases from Escherichia coli (Crookes'' strain).</bp:TITLE>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">4198624</bp:ID>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Perham RN</bp:AUTHORS>\r\n      <bp:YEAR>1973</bp:YEAR>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Stribling D</bp:AUTHORS>\r\n      <bp:SOURCE rdf:datatype="xs:string">Biochem J 1973;131(4);833-41</bp:SOURCE>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-144">\r\n      <bp:AUTHORS rdf:datatype="xs:string">Baldwin SA</bp:AUTHORS>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Perham RN</bp:AUTHORS>\r\n      <bp:TITLE rdf:datatype="xs:string">Cloning, sequence analysis and over-expression of the gene for the class II fructose 1,6-bisphosphate aldolase of Escherichia coli.</bp:TITLE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Alefounder PR</bp:AUTHORS>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Short NJ</bp:AUTHORS>\r\n      <bp:SOURCE rdf:datatype="xs:string">Biochem J 1989;257(2);529-34</bp:SOURCE>\r\n      <bp:YEAR>1989</bp:YEAR>\r\n      <bp:ID rdf:datatype="xs:string">2649077</bp:ID>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:DIRECTION rdf:datatype="xs:string">REVERSIBLE</bp:DIRECTION>\r\n  <bp:COMMENT rdf:datatype="xs:string">Class II enzymes utilize a divalent metal ion to act as the\r\nelectron sink at the active site in what appears to be an otherwise\r\nsimilar catalytic mechanism to Class I. |CITS: [89193446]|\r\nThe metal ion in the active site varies, but several metals including\r\nzinc, cobalt, iron, nickel and manganese can form an active\r\nmetallo-protein complex |CITS: [73229139]|\r\nIn Crookes strain of E. coli it was found that the kinetic behavior is not\r\ntypical of a class-II aldolase; the enzyme has no requirement for\r\nthiol compounds either for stability or activity, added K+ ions have\r\nno effect, and the high pH optimum of 9 is unusual for a class II\r\nenzyme. |CITS: [78165651]| Aldolase II  is relatively insensitive to\r\ncompounds that react with thiol groups.|CITS: [78165651]| It is\r\nstrongly inhibited by metal-chelating agents and is reactivated by\r\nbivalent metal ions.|CITS: [73229139]|  When E. coli K-12 is grown on C-3 carbon\r\nsources both classes of aldolase are present.  However the Class I enzyme is \r\npresent only under these conditions.  Therefore the Class I enzyme is most \r\nlikely involved in gluconeogenesis and the Class II enzyme with glycolysis. \r\n|CITS: [81000551]|</bp:COMMENT>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-145">\r\n      <bp:SOURCE rdf:datatype="xs:string">Biochem J 1978;169(3);633-41</bp:SOURCE>\r\n      <bp:YEAR>1978</bp:YEAR>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Stribling D</bp:AUTHORS>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Baldwin SA</bp:AUTHORS>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Perham RN</bp:AUTHORS>\r\n      <bp:TITLE rdf:datatype="xs:string">Purification and characterization of the class-II D-fructose 1,6-bisphosphate aldolase from Escherichia coli (Crookes'' strain).</bp:TITLE>\r\n      <bp:ID rdf:datatype="xs:string">417719</bp:ID>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:CONTROLLER>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-146">\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-101" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:CONTROLLER>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">fructose-1,6-bisphosphate triosephosphate lyase</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">fructose-1,6-bisphosphate aldolase</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-426">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">42</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:catalysis>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
