INSERT INTO `cpath` VALUES (59, '6PFK-1-CPX', '6PFK-1-CPX', 'PHYSICAL_ENTITY', 'complex', 83333, 'BIO_PAX', '<bp:complex xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-59">\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-182">\r\n      <bp:AUTHORS rdf:datatype="xs:string">Evans PR</bp:AUTHORS>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Rypniewski WR</bp:AUTHORS>\r\n      <bp:TITLE rdf:datatype="xs:string">Crystal structure of unliganded phosphofructokinase from Escherichia coli.</bp:TITLE>\r\n      <bp:YEAR>1989</bp:YEAR>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:SOURCE rdf:datatype="xs:string">J Mol Biol 1989;207(4);805-21</bp:SOURCE>\r\n      <bp:ID rdf:datatype="xs:string">2527305</bp:ID>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:COMMENT rdf:datatype="xs:string">This enzyme is an isozyme with phosphofructokinase-2. The\r\nnucleotide sequences of the genes are not similar |CITS: [85203917]|. The\r\ntetrameric species is the only one which can bind both substrates and\r\neffectors, and thus have both catalytic and regulatory properties. The\r\nC terminal end of the peptide is required for allosteric\r\nproperties.|CITS: [90276415]| Crystal structures have been solved\r\nwith and without activators and inhibitors. |CITS: [89342465], [89125622]|</bp:COMMENT>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-183">\r\n      <bp:ID rdf:datatype="xs:string">2975709</bp:ID>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Shirakihara Y</bp:AUTHORS>\r\n      <bp:SOURCE rdf:datatype="xs:string">J Mol Biol 1988;204(4);973-94</bp:SOURCE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Evans PR</bp:AUTHORS>\r\n      <bp:YEAR>1988</bp:YEAR>\r\n      <bp:TITLE rdf:datatype="xs:string">Crystal structure of the complex of phosphofructokinase from Escherichia coli with its reaction products.</bp:TITLE>\r\n      <bp:DB rdf:datatype="xs:str