INSERT INTO `cpath` VALUES (70, 'ENOLASE-CPLX', 'ENOLASE-CPLX', 'PHYSICAL_ENTITY', 'complex', 83333, 'BIO_PAX', '<bp:complex xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-70">\r\n  <bp:COMMENT rdf:datatype="xs:string">The enzyme denatures in the absence of Mg.  When E. coli enolase was\r\ntreated with EDTA in attempts to remove all residual activity prior to\r\nthe Mg activation studies, it was found that the enzyme was unstable in\r\nthe absence of Mg and that substantial and irreversible loss of\r\nactivity was observed after very short exposure of the enzyme to EDTA.\r\n|CITS:[72060411]|</bp:COMMENT>\r\n  <bp:COMPONENTS>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-227">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>2</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-71" />\r\n      <bp:CELLULAR-LOCATION>\r\n        <bp:openControlledVocabulary rdf:ID="CPATH-LOCAL-228">\r\n          <bp:TERM>cytoplasm</bp:TERM>\r\n          <bp:XREF>\r\n            <bp:unificationXref rdf:ID="CPATH-LOCAL-229">\r\n              <bp:DB>GO</bp:DB>\r\n              <bp:ID>GO:0005737</bp:ID>\r\n            </bp:unificationXref>\r\n          </bp:XREF>\r\n        </bp:openControlledVocabulary>\r\n      </bp:CELLULAR-LOCATION>\r\n    </bp:physicalEntityParticipant>\r\n  </bp:COMPONENTS>\r\n  <bp:NAME rdf:datatype="xs:string">ENOLASE-CPLX</bp:NAME>\r\n  <bp:ORGANISM>\r\n    <bp:bioSource rdf:ID="CPATH-LOCAL-230">\r\n      <bp:NAME rdf:datatype="xs:string">Escherichia coli K-12</bp:NAME>\r\n      <bp:TAXON-XREF>\r\n        <bp:unificationXref rdf:ID="CPATH-LOCAL-231">\r\n          <bp:ID>83333</bp:ID>\r\n          <bp:DB>taxon</bp:DB>\r\n          <bp:COMMENT>Escherichia coli K-12</bp:COMMENT>\r\n        </bp:unificationXref>\r\n      </bp:TAXON-XREF>\r\n    </bp:bioSource>\r\n  </bp:ORGANISM>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-454">\r\n     