INSERT INTO `cpath` VALUES (75, 'PKI-COMPLEX', 'PKI-COMPLEX', 'PHYSICAL_ENTITY', 'complex', 83333, 'BIO_PAX', '<bp:complex xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-75">\r\n  <bp:NAME rdf:datatype="xs:string">PKI-COMPLEX</bp:NAME>\r\n  <bp:COMPONENTS>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-244">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>4</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-76" />\r\n      <bp:CELLULAR-LOCATION>\r\n        <bp:openControlledVocabulary rdf:ID="CPATH-LOCAL-245">\r\n          <bp:TERM>cellular_component unknown</bp:TERM>\r\n          <bp:XREF>\r\n            <bp:unificationXref rdf:ID="CPATH-LOCAL-246">\r\n              <bp:DB>GO</bp:DB>\r\n              <bp:ID>GO:0008372</bp:ID>\r\n            </bp:unificationXref>\r\n          </bp:XREF>\r\n        </bp:openControlledVocabulary>\r\n      </bp:CELLULAR-LOCATION>\r\n    </bp:physicalEntityParticipant>\r\n  </bp:COMPONENTS>\r\n  <bp:ORGANISM>\r\n    <bp:bioSource rdf:ID="CPATH-LOCAL-247">\r\n      <bp:NAME rdf:datatype="xs:string">Escherichia coli K-12</bp:NAME>\r\n      <bp:TAXON-XREF>\r\n        <bp:unificationXref rdf:ID="CPATH-LOCAL-248">\r\n          <bp:ID>83333</bp:ID>\r\n          <bp:DB>taxon</bp:DB>\r\n          <bp:COMMENT>Escherichia coli K-12</bp:COMMENT>\r\n        </bp:unificationXref>\r\n      </bp:TAXON-XREF>\r\n    </bp:bioSource>\r\n  </bp:ORGANISM>\r\n  <bp:COMMENT rdf:datatype="xs:string">Pyruvate kinase I and pyruvate kinase II differ in physical and chemical properties as\r\nwell as in their kinetic behavior.  Although the two forms are under\r\nindependent genetic control they do coexist in a wide range of\r\nnutritional and metabolic states. The two forms are\r\nnot interconvertible.  Both show positive cooperative effects with\r\nrespect to the substrate phosphoenolpyruvate.|CITS:[83114522]| The\r\nenzyme has a low nucleotide specificity and the 5''-diphosphates of\r\nguanosine, inosine, uridine and cytidine can all serve as phospho\r\nacceptors.|CITS: [90336973]| Form I from E coli unlike form II is remarkably\r\nstable. |CITS:[91315755]|</bp:COMMENT>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-459">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">75</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:complex>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (76, 'pyruvate kinase I monomer', 'pyruvate kinase I monomer', 'PHYSICAL_ENTITY', 'protein', 83333, 'BIO_PAX', '<bp:protein xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-76">\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-249">\r\n      <bp:DB rdf:datatype="xs:string">PIR</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">b1676</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-250">\r\n      <bp:DB rdf:datatype="xs:string">SWISS-PROT</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">P14178</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-251">\r\n      <bp:ID rdf:datatype="xs:string">1E0T</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">PDB</bp:DB>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">B1676</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-252">\r\n      <bp:ID rdf:datatype="xs:string">NP_416191</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">RefSeq</bp:DB>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:SEQUENCE rdf:datatype="xs:string"></bp:SEQUENCE>\r\n  <bp:COMMENT rdf:datatype="xs:string">Type I pyruvate kinase is made up of 522 amino acids.\r\nNeither type I nor II contains tryptophan. The two forms of the enzyme, I and II are\r\ndifferent proteins.|CITS:[83114522]| Pyruvate kinase F was previously\r\nreferred to as pyruvate kinase B, now as I |CITS:[84029179]| A free N-terminal\r\namino acid can be detected in both forms of pyruvate kinase it\r\ncorresponds to methionine for type I and serine for type\r\nII.|CITS:[83114522]| Comparison with the known primary structures shows that\r\nbacterial enzymes lack a substantial portion of the N-terminal\r\nsequence with respect to pyruvate kinases from vertebrates. |CITS:[91315755]|</bp:COMMENT>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-253">\r\n      <bp:ID rdf:datatype="xs:string">P14178</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">SWISS-MODEL</bp:DB>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:NAME rdf:datatype="xs:string">pyruvate kinase I monomer</bp:NAME>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-254">\r\n      <bp:ID rdf:datatype="xs:string">1E0U</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">PDB</bp:DB>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">PykF</bp:SYNONYMS>\r\n  <bp:ORGANISM>\r\n    <bp:bioSource rdf:ID="CPATH-LOCAL-255">\r\n      <bp:NAME rdf:datatype="xs:string">Escherichia coli K-12</bp:NAME>\r\n      <bp:TAXON-XREF>\r\n        <bp:unificationXref rdf:ID="CPATH-LOCAL-256">\r\n          <bp:ID>83333</bp:ID>\r\n          <bp:DB>taxon</bp:DB>\r\n          <bp:COMMENT>Escherichia coli K-12</bp:COMMENT>\r\n        </bp:unificationXref>\r\n      </bp:TAXON-XREF>\r\n    </bp:bioSource>\r\n  </bp:ORGANISM>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-257">\r\n      <bp:ID rdf:datatype="xs:string">1PKY</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">PDB</bp:DB>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:relationshipXref rdf:ID="CPATH-LOCAL-258">\r\n      <bp:DB rdf:datatype="xs:string">EcoO157Cyc</bp:DB>\r\n      <bp:RELATIONSHIP-TYPE rdf:datatype="xs:string">Ortholog</bp:RELATIONSHIP-TYPE>\r\n      <bp:ID rdf:datatype="xs:string">PYKF-MONOMER</bp:ID>\r\n    </bp:relationshipXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-460">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">76</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:protein>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
