\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Seta FD</bp:AUTHORS>\r\n      <bp:SOURCE rdf:datatype="xs:string">J Bacteriol 1997;179(16);5218-21</bp:SOURCE>\r\n      <bp:TITLE rdf:datatype="xs:string">Characterization of Escherichia coli strains with gapA and gapB genes deleted.</bp:TITLE>\r\n      <bp:YEAR>1997</bp:YEAR>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Boschi-Muller S</bp:AUTHORS>\r\n      <bp:ID rdf:datatype="xs:string">9260967</bp:ID>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Branlant G</bp:AUTHORS>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-293">\r\n      <bp:ID rdf:datatype="xs:string">2124629</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:YEAR>1990</bp:YEAR>\r\n      <bp:SOURCE rdf:datatype="xs:string">J Mol Evol 1990;31(5);383-8</bp:SOURCE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Alberro MR</bp:AUTHORS>\r\n      <bp:TITLE rdf:datatype="xs:string">A naturally occurring horizontal gene transfer from a eukaryote to a prokaryote.</bp:TITLE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Anderson KL</bp:AUTHORS>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Feng DF</bp:AUTHORS>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Doolittle RF</bp:AUTHORS>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:COMPONENTS>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-294">\r\n      <bp:CELLULAR-LOCATION>\r\n        <bp:openControlledVocabulary rdf:ID="CPATH-LOCAL-295">\r\n          <bp:TERM>cytoplasm</bp:TERM>\r\n          <bp:XREF>\r\n            <bp:unificationXref rdf:ID="CPATH-LOCAL-296">\r\n              <bp:DB>GO</bp:DB>\r\n              <bp:ID>GO:0005737</bp:ID>\r\n            </bp:unificationXref>\r\n          </bp:XREF>\r\n        </bp:openControlledVocabulary>\r\n      </bp:CELLULAR-LOCATION>\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>4</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-89" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:COMPONENTS>\r\n  <bp:COMMENT rdf:datatype="xs:string">E.coli is unusual in having two glyceraldehyde-3-phosphate dehydrogenases. \r\nThe protein GAPDH-A has a sequence that is more similar to eukaryotic\r\nsequences than it is to prokaryotic types |CITS:[91087241]|.  GapA is required \r\nfor glycolysis, while Epd (GapB) is not |CITS: [9260967]|.  GapA and Epd may be involved\r\nin production of pyridoxal 5''-phosphate (PLP) |CITS: [9696782]|.</bp:COMMENT>\r\n  <bp:ORGANISM>\r\n    <bp:bioSource rdf:ID="CPATH-LOCAL-297">\r\n      <bp:NAME rdf:datatype="xs:string">Escherichia coli K-12</bp:NAME>\r\n      <bp:TAXON-XREF>\r\n        <bp:unificationXref rdf:ID="CPATH-LOCAL-298">\r\n          <bp:ID>83333</bp:ID>\r\n          <bp:DB>taxon</bp:DB>\r\n          <bp:COMMENT>Escherichia coli K-12</bp:COMMENT>\r\n        </bp:unificationXref>\r\n      </bp:TAXON-XREF>\r\n    </bp:bioSource>\r\n  </bp:ORGANISM>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-472">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">88</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:complex>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (89, 'glyceraldehyde 3-phosphate dehydrogenase-A monomer', 'glyceraldehyde 3-phosphate dehydrogenase-A monomer', 'PHYSICAL_ENTITY', 'protein', 83333, 'BIO_PAX', '<bp:protein xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-89">\r\n  <bp:SEQUENCE rdf:datatype="xs:string"></bp:SEQUENCE>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-299">\r\n      <bp:ID rdf:datatype="xs:string">2990926</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Branlant C</bp:AUTHORS>\r\n      <bp:TITLE rdf:datatype="xs:string">Nucleotide sequence of the Escherichia coli gap gene. Different evolutionary behavior of the NAD+-binding domain and of the catalytic domain of D-glyceraldehyde-3-phosphate dehydrogenase.</bp:TITLE>\r\n      <bp:YEAR>1985</bp:YEAR>\r\n      <bp:SOURCE rdf:datatype="xs:string">Eur J Biochem 1985;150(1);61-6</bp:SOURCE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Branlant G</bp:AUTHORS>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-300">\r\n      <bp:ID rdf:datatype="xs:string">NP_416293</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">RefSeq</bp:DB>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">B1779</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">Gap1</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-301">\r\n      <bp:AUTHORS rdf:datatype="xs:string">Vignais ML</bp:AUTHORS>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Seta FD</bp:AUTHORS>\r\n      <bp:SOURCE rdf:datatype="xs:string">J Bacteriol 1997;179(16);5218-21</bp:SOURCE>\r\n      <bp:TITLE rdf:datatype="xs:string">Characterization of Escherichia coli strains with gapA and gapB genes deleted.</bp:TITLE>\r\n      <bp:YEAR>1997</bp:YEAR>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Boschi-Muller S</bp:AUTHORS>\r\n      <bp:ID rdf:datatype="xs:string">9260967</bp:ID>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Branlant G</bp:AUTHORS>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-302">\r\n      <bp:DB rdf:datatype="xs:string">SWISS-MODEL</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">P06977</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:NAME rdf:datatype="xs:string">glyceraldehyde 3-phosphate dehydrogenase-A monomer</bp:NAME>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">GapA</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-303">\r\n      <bp:DB rdf:datatype="xs:string">PDB</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">1GAD</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">Gad</bp:SYNONYMS>\r\n  <bp:ORGANISM>\r\n    <bp:bioSource rdf:ID="CPATH-LOCAL-304">\r\n      <bp:NAME rdf:datatype="xs:string">Escherichia coli K-12</bp:NAME>\r\n      <bp:TAXON-XREF>\r\n        <bp:unificationXref rdf:ID="CPATH-LOCAL-305">\r\n          <bp:ID>83333</bp:ID>\r\n          <bp:DB>taxon</bp:DB>\r\n          <bp:COMMENT>Escherichia coli K-12</bp:COMMENT>\r\n        </bp:unificationXref>\r\n      </bp:TAXON-XREF>\r\n    </bp:bioSource>\r\n  </bp:ORGANISM>\r\n  <bp:COMMENT rdf:datatype="xs:string">A higher degree of sequence homology exists between E.coli\r\nand eucaryotic enzymes than betwen E. coli and the thermophilic bacterial\r\nenzyme |CITS:[85257641]|.  Mutant exhibits a growth defect and also exhibits \r\nincreased aggregation and lysis that are rescued by high-salt media |CITS: [9260967]|.\r\n\r\nRegulation has been described |CITS: [12672900]|.  The regulation of the fkpA, gapA, and hslT genes is affected by evolution under conditions of chronic heat stress |CITS: [12672900]|.</bp:COMMENT>\r\n  <bp:XREF>\r\n    <bp:relationshipXref rdf:ID="CPATH-LOCAL-306">\r\n      <bp:DB rdf:datatype="xs:string">EcoO157Cyc</bp:DB>\r\n      <bp:RELATIONSHIP-TYPE rdf:datatype="xs:string">Ortholog</bp:RELATIONSHIP-TYPE>\r\n      <bp:ID rdf:datatype="xs:string">GAPA-MONOMER</bp:ID>\r\n    </bp:relationshipXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-307">\r\n      <bp:DB rdf:datatype="xs:string">PIR</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">b1779</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-308">\r\n      <bp:DB rdf:datatype="xs:string">PDB</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">1GAE</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-309">\r\n      <bp:DB rdf:datatype="xs:string">SWISS-PROT</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">P06977</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-473">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">89</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:protein>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (90, 'PGK', 'PGK', 'PHYSICAL_ENTITY', 'protein', 83333, 'BIO_PAX', '<bp:protein xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-90">\r\n  <bp:NAME rdf:datatype="xs:string">PGK</bp:NAME>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-310">\r\n      <bp:DB rdf:datatype="xs:string">SWISS-PROT</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">P11665</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:SEQUENCE rdf:datatype="xs:string"></bp:SEQUENCE>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-311">\r\n      <bp:ID rdf:datatype="xs:string">b2926</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">PIR</bp:DB>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:COMMENT rdf:datatype="xs:string">Phosphoglycerate kinase is one of the proteins induced by anaerobiosis.\r\n|CITS:[89306676]| The gene is transcribed from two promoters, one immediately\r\nin front of an upstream gene coding for a 38-kDa polypeptide of\r\nunknown function. The pgk gene was also found to show growth phase regulation.  A\r\nstructural determinant for glycerate 3-P kinase is located near serA.\r\nThe map order is speB-pgk-serA-lysA-argA-eno-cysC.|CITS:[76195925]|\r\n\r\nPgk has similarity to an &lt;i&gt;Edwardsiella ictaluri&lt;/i&gt; protein |CITS: [12542086]|.</bp:COMMENT>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">Pgk</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-312">\r\n      <bp:ID rdf:datatype="xs:string">NP_417401</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">RefSeq</bp:DB>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-313">\r\n      <bp:ID rdf:datatype="xs:string">P11665</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">SWISS-MODEL</bp:DB>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">B2926</bp:SYNONYMS>\r\n  <bp:ORGANISM>\r\n    <bp:bioSource rdf:ID="CPATH-LOCAL-314">\r\n      <bp:NAME rdf:datatype="xs:string">Escherichia coli K-12</bp:NAME>\r\n      <bp:TAXON-XREF>\r\n        <bp:unificationXref rdf:ID="CPATH-LOCAL-315">\r\n          <bp:ID>83333</bp:ID>\r\n          <bp:DB>taxon</bp:DB>\r\n          <bp:COMMENT>Escherichia coli K-12</bp:COMMENT>\r\n        </bp:unificationXref>\r\n      </bp:TAXON-XREF>\r\n    </bp:bioSource>\r\n  </bp:ORGANISM>\r\n  <bp:XREF>\r\n    <bp:relationshipXref rdf:ID="CPATH-LOCAL-316">\r\n      <bp:DB rdf:datatype="xs:string">EcoO157Cyc</bp:DB>\r\n      <bp:RELATIONSHIP-TYPE rdf:datatype="xs:string">Ortholog</bp:RELATIONSHIP-TYPE>\r\n      <bp:ID rdf:datatype="xs:string">G7E-3-MONOMER</bp:ID>\r\n    </bp:relationshipXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-474">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">90</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:protein>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
