-3P-atom6 GLYCEROL-3P-atom3" order="1"/&gt;\r\n    &lt;bond id="GLYCEROL-3P-bond6" atomRefs="GLYCEROL-3P-atom5 GLYCEROL-3P-atom6" order="1"/&gt;\r\n    &lt;bond id="GLYCEROL-3P-bond7" atomRefs="GLYCEROL-3P-atom4 GLYCEROL-3P-atom3" order="1"/&gt;\r\n    &lt;bond id="GLYCEROL-3P-bond8" atomRefs="GLYCEROL-3P-atom2 GLYCEROL-3P-atom7" order="1"/&gt;\r\n    &lt;bond id="GLYCEROL-3P-bond9" atomRefs="GLYCEROL-3P-atom1 GLYCEROL-3P-atom8" order="1"/&gt;\r\n   &lt;/bondArray&gt;\r\n   &lt;formula concise="C 3 H 9 O 6 P 1" formalCharge="0"/&gt;\r\n   &lt;float title="molecularWeight" units="g/mol"&gt;172.074&lt;/float&gt;\r\n   &lt;string title="smiles"&gt;C(C(O)CO)OP(=O)(O)O&lt;/string&gt;\r\n  &lt;/molecule&gt;\r\n &lt;/cml&gt;</bp:STRUCTURE-DATA>\r\n    </bp:chemicalStructure>\r\n  </bp:STRUCTURE>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">&amp;alpha;-glycerophosphate</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">glycerol-3-P</bp:SYNONYMS>\r\n  <bp:NAME rdf:datatype="xs:string">glycerol-3-phosphate</bp:NAME>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">D-glycerol-3-phosphate</bp:SYNONYMS>\r\n  <bp:MOLECULAR-WEIGHT>172.07400512695312</bp:MOLECULAR-WEIGHT>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-355">\r\n      <bp:DB rdf:datatype="xs:string">CAS</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">57-03-4</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">sn-glycerol-3-phosphate</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-484">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">100</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:smallMolecule>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (101, 'FRUCBISALD-CLASSII', 'FRUCBISALD-CLASSII', 'PHYSICAL_ENTITY', 'complex', 83333, 'BIO_PAX', '<bp:complex xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-101">\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-356">\r\n      <bp:AUTHORS rdf:datatype="xs:string">Baldwin SA</bp:AUTHORS>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Perham RN</bp:AUTHORS>\r\n      <bp:TITLE rdf:datatype="xs:string">Cloning, sequence analysis and over-expression of the gene for the class II fructose 1,6-bisphosphate aldolase of Escherichia coli.</bp:TITLE>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Alefounder PR</bp:AUTHORS>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Short NJ</bp:AUTHORS>\r\n      <bp:SOURCE rdf:datatype="xs:string">Biochem J 1989;257(2);529-34</bp:SOURCE>\r\n      <bp:YEAR>1989</bp:YEAR>\r\n      <bp:ID rdf:datatype="xs:string">2649077</bp:ID>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:COMMENT rdf:datatype="xs:string">In relation to the Class I enzymes (primarily studied and found in\r\n eukaryotes) comparatively little is known about the class II enzymes. \r\n The Class II aldolases of Sacc. cer. and E. coli are the best\r\n characterized.|CITS: [89193446]| It resembles the typical class II\r\n aldolase from yeast in size and amino acid composition. This is a\r\n strong suggestion that they are related. |CITS:[78165651]| These less\r\n well studied aldolases are found both in the eukaryotic green algae\r\n and fungi, and in the prokaryotic blue-green algae and bacteria.\r\n |CITS:[78165651]|\r\n The gene pgk, encoding the enzyme phosphoglycerate\r\n kinase, was carried on plasmid pLC33-5 of the collection of Clarke and\r\n Carbon. It was also noted that E.coli cells tansformed with this\r\n plasmid exhibited raised levels of Class II fructose 1,6 bisphosphate\r\n aldolase activity, suggesting that the same plasmid might also carry\r\n the structural gene (fba) for this enzyme. |CITS: [89193446]|</bp:COMMENT>\r\n  <bp:XREF>\r\n    <bp:publicationXref rdf:ID="CPATH-LOCAL-357">\r\n      <bp:SOURCE rdf:datatype="xs:string">Biochem J 1978;169(3);633-41</bp:SOURCE>\r\n      <bp:YEAR>1978</bp:YEAR>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Stribling D</bp:AUTHORS>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Baldwin SA</bp:AUTHORS>\r\n      <bp:DB rdf:datatype="xs:string">PubMed</bp:DB>\r\n      <bp:AUTHORS rdf:datatype="xs:string">Perham RN</bp:AUTHORS>\r\n      <bp:TITLE rdf:datatype="xs:string">Purification and characterization of the class-II D-fructose 1,6-bisphosphate aldolase from Escherichia coli (Crookes'' strain).</bp:TITLE>\r\n      <bp:ID rdf:datatype="xs:string">417719</bp:ID>\r\n    </bp:publicationXref>\r\n  </bp:XREF>\r\n  <bp:COMPONENTS>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-358">\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>2</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:CELLULAR-LOCATION>\r\n        <bp:openControlledVocabulary rdf:ID="CPATH-LOCAL-359">\r\n          <bp:TERM>cellular_component unknown</bp:TERM>\r\n          <bp:XREF>\r\n            <bp:unificationXref rdf:ID="CPATH-LOCAL-360">\r\n              <bp:DB>GO</bp:DB>\r\n              <bp:ID>GO:0008372</bp:ID>\r\n            </bp:unificationXref>\r\n          </bp:XREF>\r\n        </bp:openControlledVocabulary>\r\n      </bp:CELLULAR-LOCATION>\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-102" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:COMPONENTS>\r\n  <bp:NAME rdf:datatype="xs:string">FRUCBISALD-CLASSII</bp:NAME>\r\n  <bp:ORGANISM>\r\n    <bp:bioSource rdf:ID="CPATH-LOCAL-361">\r\n      <bp:NAME rdf:datatype="xs:string">Escherichia coli K-12</bp:NAME>\r\n      <bp:TAXON-XREF>\r\n        <bp:unificationXref rdf:ID="CPATH-LOCAL-362">\r\n          <bp:ID>83333</bp:ID>\r\n          <bp:DB>taxon</bp:DB>\r\n          <bp:COMMENT>Escherichia coli K-12</bp:COMMENT>\r\n        </bp:unificationXref>\r\n      </bp:TAXON-XREF>\r\n    </bp:bioSource>\r\n  </bp:ORGANISM>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-485">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">101</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:complex>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (102, 'fructose bisphosphate aldolase monomer', 'fructose bisphosphate aldolase monomer', 'PHYSICAL_ENTITY', 'protein', 83333, 'BIO_PAX', '<bp:protein xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-102">\r\n  <bp:XREF>\r\n    <bp:relationshipXref rdf:ID="CPATH-LOCAL-363">\r\n      <bp:RELATIONSHIP-TYPE rdf:datatype="xs:string">Ortholog</bp:RELATIONSHIP-TYPE>\r\n      <bp:DB rdf:datatype="xs:string">EcoO157Cyc</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">FBA-MONOMER</bp:ID>\r\n    </bp:relationshipXref>\r\n  </bp:XREF>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">Fda</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-364">\r\n      <bp:DB rdf:datatype="xs:string">PDB</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">1ZEN</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:COMMENT rdf:datatype="xs:string">The amino acid sequence of the E.coli Class II\r\nfructose-1,6-bisphosphate aldolase inferred from the DNA sequence of\r\nthe fda gene is the first primary structure of a Class II aldolase to be\r\nestablished.  There is no immediately apparent sequence homology with\r\nany of the Class I fructose-1,6-bisphosphate aldolases which have been\r\nwidely studied. |CITS:[89193446]|\r\n\r\nAn fda mutant exhibits a heat-sensitive defect in rRNA transcription that is elicited via altered abundance of ppGpp and of initiating NTPs |CITS: [14526031]|.\r\n\r\nFda has similarity to an &lt;i&gt;Edwardsiella ictaluri&lt;/i&gt; protein that provokes an immune response in catfish |CITS: [12542086]|.</bp:COMMENT>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-365">\r\n      <bp:DB rdf:datatype="xs:string">SWISS-PROT</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">P11604</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-366">\r\n      <bp:ID rdf:datatype="xs:string">1DOS</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">PDB</bp:DB>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:SEQUENCE rdf:datatype="xs:string"></bp:SEQUENCE>\r\n  <bp:ORGANISM>\r\n    <bp:bioSource rdf:ID="CPATH-LOCAL-367">\r\n      <bp:NAME rdf:datatype="xs:string">Escherichia coli K-12</bp:NAME>\r\n      <bp:TAXON-XREF>\r\n        <bp:unificationXref rdf:ID="CPATH-LOCAL-368">\r\n          <bp:ID>83333</bp:ID>\r\n          <bp:DB>taxon</bp:DB>\r\n          <bp:COMMENT>Escherichia coli K-12</bp:COMMENT>\r\n        </bp:unificationXref>\r\n      </bp:TAXON-XREF>\r\n    </bp:bioSource>\r\n  </bp:ORGANISM>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">FbaA</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-369">\r\n      <bp:ID rdf:datatype="xs:string">NP_417400</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">RefSeq</bp:DB>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:NAME rdf:datatype="xs:string">fructose bisphosphate aldolase monomer</bp:NAME>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-370">\r\n      <bp:ID rdf:datatype="xs:string">b2925</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">PIR</bp:DB>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">Ald</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">Fba</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">B2925</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-486">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">102</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:protein>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (103, 'FRUCBISALD-CLASSI', 'FRUCBISALD-CLASSI', 'PHYSICAL_ENTITY', 'complex', 83333, 'BIO_PAX', '<bp:complex xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-103">\r\n  <bp:ORGANISM>\r\n    <bp:bioSource rdf:ID="CPATH-LOCAL-371">\r\n      <bp:NAME rdf:datatype="xs:string">Escherichia coli K-12</bp:NAME>\r\n      <bp:TAXON-XREF>\r\n        <bp:unificationXref rdf:ID="CPATH-LOCAL-372">\r\n          <bp:ID>83333</bp:ID>\r\n          <bp:DB>taxon</bp:DB>\r\n          <bp:COMMENT>Escherichia coli K-12</bp:COMMENT>\r\n        </bp:unificationXref>\r\n      </bp:TAXON-XREF>\r\n    </bp:bioSource>\r\n  </bp:ORGANISM>\r\n  <bp:NAME rdf:datatype="xs:string">FRUCBISALD-CLASSI</bp:NAME>\r\n  <bp:COMPONENTS>\r\n    <bp:physicalEntityParticipant rdf:ID="CPATH-LOCAL-373">\r\n      <bp:CELLULAR-LOCATION>\r\n        <bp:openControlledVocabulary rdf:ID="CPATH-LOCAL-374">\r\n          <bp:TERM>cellular_component unknown</bp:TERM>\r\n          <bp:XREF>\r\n            <bp:unificationXref rdf:ID="CPATH-LOCAL-375">\r\n              <bp:DB>GO</bp:DB>\r\n              <bp:ID>GO:0008372</bp:ID>\r\n            </bp:unificationXref>\r\n          </bp:XREF>\r\n        </bp:openControlledVocabulary>\r\n      </bp:CELLULAR-LOCATION>\r\n      <bp:STOICHIOMETRIC-COEFFICIENT>10</bp:STOICHIOMETRIC-COEFFICIENT>\r\n      <bp:PHYSICAL-ENTITY rdf:resource="#CPATH-104" />\r\n    </bp:physicalEntityParticipant>\r\n  </bp:COMPONENTS>\r\n  <bp:COMMENT rdf:datatype="xs:string">The typical class I aldolases of plants and animals have been\r\nthroroughly studied  |CITS: [78165651]| Fructose-1,6-bisphosphate\r\naldolases can be divided into two\r\nclasses on the basis of their catalytic and structural properties.\r\n|CITS: [78165651]| Class I fructose 1,6 bisphosphate aldolases were\r\nonce thought\r\nto be confined to eukaryotic organisms but have since been detected in\r\nseveral bacterial species. |CITS: [78165652]| The occurence of such\r\nan aldolase in bacteria was unexpected in light of the\r\nphylogenetic distribution of aldolases. |CITS: [73229139]|  The\r\nenzymes of eukaryotes generally fall into Class I and are tetramers of\r\nidentical polypeptide chains. |CITS: [89193446]|\r\nIn earlier studies |CITS: [73229139]| it was thought that the class I E. coli\r\naldolase was typical in that it was tetrameric with a mol. wt.\r\nof approx. 140K. In 1978 new purification techniques were used.The true aldolase 1\r\nactivity could be measured by using Fru-1,6-P&lt;SUB&gt;2&lt;/SUB&gt; that had been purified\r\nby chromatography on DEAE-cellulose to remove the\r\nfructose-6-phosphate.  Using these methods the enzyme appeared to be\r\nlarger than was previously supposed and may be a decamer with a mol. wt.\r\nof approx.  340,000. The size of aldolase 1 and the effect of cross-linking reagents\r\non it, indicate that its structure must differ significantly from that\r\nof the typical tetrameric class-I enzymes from eukaryotes. |CITS: [78165652]\r\n[73229139]|</bp:COMMENT>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-487">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">103</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:complex>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
INSERT INTO `cpath` VALUES (104, 'fructose bisphosphate aldolase monomer', 'fructose bisphosphate aldolase monomer', 'PHYSICAL_ENTITY', 'protein', 83333, 'BIO_PAX', '<bp:protein xmlns:bp="http://www.biopax.org/release/biopax-level1.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-104">\r\n  <bp:XREF>\r\n    <bp:relationshipXref rdf:ID="CPATH-LOCAL-376">\r\n      <bp:ID rdf:datatype="xs:string">Z3260-MONOMER</bp:ID>\r\n      <bp:DB rdf:datatype="xs:string">EcoO157Cyc</bp:DB>\r\n      <bp:RELATIONSHIP-TYPE rdf:datatype="xs:string">Ortholog</bp:RELATIONSHIP-TYPE>\r\n    </bp:relationshipXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-377">\r\n      <bp:DB rdf:datatype="xs:string">RefSeq</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">NP_416600</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:NAME rdf:datatype="xs:string">fructose bisphosphate aldolase monomer</bp:NAME>\r\n  <bp:ORGANISM>\r\n    <bp:bioSource rdf:ID="CPATH-LOCAL-378">\r\n      <bp:NAME rdf:datatype="xs:string">Escherichia coli K-12</bp:NAME>\r\n      <bp:TAXON-XREF>\r\n        <bp:unificationXref rdf:ID="CPATH-LOCAL-379">\r\n          <bp:ID>83333</bp:ID>\r\n          <bp:DB>taxon</bp:DB>\r\n          <bp:COMMENT>Escherichia coli K-12</bp:COMMENT>\r\n        </bp:unificationXref>\r\n      </bp:TAXON-XREF>\r\n    </bp:bioSource>\r\n  </bp:ORGANISM>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-380">\r\n      <bp:DB rdf:datatype="xs:string">SWISS-PROT</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">P71295</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-381">\r\n      <bp:DB rdf:datatype="xs:string">PIR</bp:DB>\r\n      <bp:ID rdf:datatype="xs:string">b2097</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n  <bp:SEQUENCE rdf:datatype="xs:string"></bp:SEQUENCE>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">DhnA</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">FbaB</bp:SYNONYMS>\r\n  <bp:SYNONYMS rdf:datatype="xs:string">B2097</bp:SYNONYMS>\r\n  <bp:XREF>\r\n    <bp:unificationXref rdf:ID="CPATH-LOCAL-488">\r\n      <bp:DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</bp:DB>\r\n      <bp:ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">104</bp:ID>\r\n    </bp:unificationXref>\r\n  </bp:XREF>\r\n</bp:protein>', '2006-02-13 00:00:00', '2006-02-13 00:00:00');
